import { Grid, TextField } from '@material-ui/core';
import React, {useState, useEffect } from 'react';
import './App.css';

const initialValues={
    Firstname: "",
    Lastname: "",
    Middlename: "",
    phoneNumber: "",
    emai: "",
    Address: "",
    weight: 0,
    height: 0
}
function PatientForm() {
    const [values,setValues] = useState(initialValues);
  return (
    <form>
        <Grid container>
            <Grid item xs={6}>
                <TextField
                variant='outlined'
                label="First Name"
                value={values.Firstname}
                />
            </Grid>
        </Grid>
    </form>
    
  );
}

export default PatientForm;
